import React, { Component } from 'react';

class GetWeather extends Component {
	constructor() {
		super();
		this.state = {
			city: 'Boston',
			icon: 'wi wi-day-sunny display-4',
		};
	}
	render() {
		return (
			<div>
				<h3>{this.state.city}</h3>
			</div>
		);
	}
}

export default GetWeather;
